export const PublicRoutes = [
    {
        path: '/',
        name: 'home',
        redirect: '/auth/login',
    },
    {
        path: '/auth/login',
        name: 'auth.login',
        component: () => import('../modules/Home.vue')
    },
    {
        path: '/admin/dashboard',
        component: () => import('../modules/Dashboard.vue'),
        children: [
            {
                path: '',
                name: 'admin.requests',
                component: () => import('../modules/Request.vue')
            },
            {
                path: 'users',
                name: 'admin.users',
                component: () => import('../modules/Users.vue')
            },
            {
                path: 'assignation',
                name: 'admin.assignation',
                component: () => import('../modules/Assignation.vue')
            },
            {
                path: 'answer',
                name: 'admin.answer',
                component: () => import('../modules/Answer.vue')
            }
            ,
            {
                path: 'sentRequest',
                name: 'admin.sentRequest',
                component: () => import('../modules/SentRequest.vue')
            }
            ,
            {
                path: 'sentAnswer',
                name: 'admin.sentAnswer',
                component: () => import('../modules/SentAnswer.vue')
            }
            ,
            {
                path: 'addAssignation',
                name: 'admin.addAssignation',
                component: () => import('../modules/AddAssignation.vue')
            }
            ,
            {
                path: 'addUser',
                name: 'admin.addUser',
                component: () => import('../modules/AddAssignation.vue')
            }


        ]
    },
    {
        path: '/*',
        name: 'notfound',
        redirect: '/auth/login'
    },
];
